import React from "react";
import img1 from "../../assets/api-integration.jpg";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
const Card = (props) => {
  return (
    <div className="card text-center">
      <div className="overflow">
        <img src={img1} alt="Image1" />
      </div>
      <div className="card-body text-dark">
        <h4 className="card-title">Card Title</h4>
        <p className="car-text text-secondary">
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Ipsam quod
          commodi, incidunt quis non eaque rerum labore consequuntur ad,
          repellat ratione magni corrupti numquam, distinctio minima autem modi?
          Asperiores, voluptatum?
        </p>
        <a href="#" className="btn btn-outline-sucess"> Go Anywhere</a>
      </div>
    </div>
  );
};

export default Card;
